import React from "react";
import Input from "../LoginPage/Input";

export default function AuthModal() {
  return (
    <div
      className="w-screen h-screen fixed top-0 left-0 z-20 flex"
      style={{ backgroundColor: "rgba(0,0,0,.6)" }}
    >
      <div className="border-gray-700 w-full bg-white p-5 mx-4 self-center">
        <h1 className="text-2xl" mb-3>
          Log In
        </h1>
        <p>
          By continuing, you agree are setting up a Reddit account and agree to
          our User Agreement and Privacy Policy.
        </p>
        <div className=''>
          <Input type="text" className="mb-2" />
          <Input type="password" className="mb-2" />
        </div>
      </div>
    </div>
  );
}
